import React, { Component } from "react";
import "./Profile.css";

class Profile extends Component {
  render() {
    return (
      <div id="container">
        <h2>Profile</h2>
        <div class="row">
          <div class="col-md-4">
          <p>
            Hello my name is Aaron.
          </p>
          </div>
          <div class="col-md-4">
          <p>
            Image goes here
          </p>
          </div>
          <div class="col-md-4">
          <p>
            Details go here
          </p>
          </div>
        </div>
        <div class="row">
          <div class="col-md-12">
          </div>
        </div>
      </div>
    );
  }
}

export default Profile;
